    state = {
        id:"0"
    }
    render() {
        const {t} = this.props;
        return (
            <Container fluid={true} className={"about"} min-height="100px" id={this.props.id}>
                <div className={"pt-3"}>
                    <h1 className="heading-title text-center">{t('header.section2.title')}</h1>
                </div>
                <Divider orientation="vertical" flexItem />
                    <Row>
                        <Col sm={12} className="zagolov">Powiedz nam dokąd zmierzasz, a my znajdziemy dla Ciebie bezpieczną drogę.</Col>
                    </Row>
                    <Row className="p-3">
                        <Col sm={9}>

                        </Col>
                        <Col sm={3}>
                        </Col>
                    </Row>
            </Container>
        )
    }
}
export default translate(About)
